-- ----------------------------
-- Table structure for `lesson`
-- ----------------------------
DROP TABLE IF EXISTS `lesson`;
CREATE TABLE `lesson` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `organization_id` int(10) NOT NULL DEFAULT '0' COMMENT '机构id',
  `organization_name` varchar(60) NOT NULL DEFAULT '大热篮球部' COMMENT '机构名称',
  `lesson_name` varchar(60) NOT NULL DEFAULT '大热早上A班（2-99岁）' COMMENT '课程名字',
  `per_lesson_cost` double(6,2) NOT NULL DEFAULT '0.00' COMMENT '每节课费用',
  `total_cost` double(10,2) NOT NULL DEFAULT '0.00' COMMENT '总课程费用',
  `monday` enum('1','0') NOT NULL DEFAULT '0' COMMENT '1:周一上课|2:周一不上课',
  `tuesday` enum('0','1') NOT NULL DEFAULT '0' COMMENT '0不上课|1上课',
  `wednesday` enum('0','1') NOT NULL DEFAULT '0',
  `thursday` enum('0','1') NOT NULL DEFAULT '0',
  `friday` enum('0','1') NOT NULL DEFAULT '0',
  `saturday` enum('0','1') NOT NULL DEFAULT '0',
  `sunday` enum('0','1') NOT NULL DEFAULT '0',
  `session_end` time NOT NULL DEFAULT '00:00:00' COMMENT '上课结束时间',
  `session_start` time NOT NULL DEFAULT '00:00:00' COMMENT '开始上课时间',
  `start_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '课程开始时间',
  `end_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '课程结束时间',
  `venue_id` int(10) NOT NULL DEFAULT '1' COMMENT '上课场地id',
  `venue_name` varchar(60) NOT NULL DEFAULT '大热训练场1号' COMMENT '场地名称',
  `venue_adress` varchar(255) NOT NULL DEFAULT '深圳市南山区桂庙路116号阳光文体中心102' COMMENT '场地详细地址',
  `chief_coach_id` int(10) NOT NULL DEFAULT '1' COMMENT '主教练id',
  `assistant_coach_id` int(10) DEFAULT NULL COMMENT '助教id',
  `student_limit` int(3) NOT NULL DEFAULT '0' COMMENT '1-999,最大学生容量',
  `age_range` varchar(20) NOT NULL DEFAULT '5岁-6岁' COMMENT '上课学生年龄范围|不限',
  `per_site_fees` double(3,2) NOT NULL DEFAULT '0.00' COMMENT '每节课附加场地费',
  `site_fees` double(6,2) NOT NULL DEFAULT '0.00' COMMENT '总场地费',
  `total_class_hours` int(3) NOT NULL DEFAULT '1' COMMENT '总课时',
  `status` enum('0','1') NOT NULL DEFAULT '1' COMMENT '1开启|0关闭',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

