DROP TABLE IF EXISTS `sysmessage`;
CREATE TABLE `sysmessage` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL,
  `content` varchar(255) NOT NULL,
  `receive_id` int(10) NOT NULL,
  `create_time` int(10) NOT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:未读|1：已读',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of sysmessage
-- ----------------------------

-- ----------------------------
-- Table structure for `team`
-- ----------------------------
DROP TABLE IF EXISTS `team`;
CREATE TABLE `team` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `team` varchar(60) NOT NULL DEFAULT '四三班小虎队',
  `coach_id` int(10) DEFAULT '0' COMMENT '教练id',
  `coach` varchar(60) DEFAULT '无' COMMENT '教练名字',
  `assistant_coach_id` int(11) DEFAULT '0' COMMENT '副教练id',
  `assistant_coach` varchar(60) DEFAULT '无' COMMENT '副教练名字',
  `captain_id` int(10) NOT NULL DEFAULT '0' COMMENT '队长id',
  `captain` varchar(60) NOT NULL DEFAULT '无' COMMENT '队长名字',
  `committee_id` int(10) DEFAULT NULL,
  `committee` varchar(60) DEFAULT '无' COMMENT '队委',
  `leader_id` int(10) DEFAULT '0' COMMENT '关联member表id',
  `leader` varchar(60) DEFAULT '无' COMMENT '领队',
  `announcement` varchar(120) NOT NULL DEFAULT '公告：管理员有权限' COMMENT '40个字以内',
  `players` tinyint(4) NOT NULL,
  `fans` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '粉丝数量',
  `activities` int(10) NOT NULL DEFAULT '0' COMMENT '已完成活动数量',
  `match` int(10) NOT NULL DEFAULT '0',
  `session2017` tinyint(4) NOT NULL DEFAULT '0' COMMENT '场次',
  `wins2017` tinyint(4) NOT NULL DEFAULT '0',
  `lose2017` tinyint(4) NOT NULL DEFAULT '0',
  `average_year_exp` tinyint(4) NOT NULL DEFAULT '0',
  `average_height` double(4,1) NOT NULL DEFAULT '0.0' COMMENT 'cm',
  `average_age` decimal(4,1) NOT NULL DEFAULT '0.0',
  `average_weigth` decimal(4,1) NOT NULL DEFAULT '0.0' COMMENT 'kg',
  `attendance_rate` decimal(2,2) NOT NULL DEFAULT '0.00' COMMENT '出勤率',
  `blog` varchar(255) NOT NULL DEFAULT '0' COMMENT '球队外链',
  `credit` tinyint(4) unsigned NOT NULL DEFAULT '100' COMMENT '信誉，迟到-1，违约-5',
  `average_score` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '比赛平均得分',
  `logo_id` int(10) NOT NULL DEFAULT '1',
  `create_time` int(10) NOT NULL DEFAULT '0',
  `balance` double(10,2) NOT NULL DEFAULT '0.00' COMMENT '余额',
  `contract` varchar(60) NOT NULL,
  `telephone` bigint(11) NOT NULL,
  `slogan` varchar(60) NOT NULL COMMENT '口号',
  `logo` varchar(255) NOT NULL DEFAULT '''/public/upload/common/logo/logo.png''',
  `is_invite` enum('1','0') NOT NULL DEFAULT '0' COMMENT '是否需要邀请码才可以加入球队',
  `invitation_code` varchar(16) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of team
-- ----------------------------

-- ----------------------------
-- Table structure for `team_member`
-- ----------------------------
DROP TABLE IF EXISTS `team_member`;
CREATE TABLE `team_member` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `team_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '球队id',
  `team` varchar(60) NOT NULL,
  `member_id` int(10) NOT NULL DEFAULT '10',
  `member` varchar(60) NOT NULL DEFAULT '篮球爱好者' COMMENT '名字',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '0:队员|1:队长|2：教练|3：领队|4：队委|5：副领队|6：副队长|7:副教练；',
  `portrait` varchar(255) NOT NULL COMMENT '头像地址',
  `status` tinyint(4) NOT NULL DEFAULT '3' COMMENT '0:申请加入；|1：允许入队；|2：已拒绝；|4：踢出队伍;|5:退出队伍;|3:个人',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  `create_time` int(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of team_member
-- ----------------------------

-- ----------------------------
-- Table structure for `train`
-- ----------------------------
DROP TABLE IF EXISTS `train`;
CREATE TABLE `train` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `team_id` int(10) NOT NULL,
  `team` varchar(60) NOT NULL,
  `subject` varchar(255) NOT NULL,
  `coach_id` int(10) NOT NULL,
  `coach` varchar(60) NOT NULL,
  `train_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `province` varchar(60) NOT NULL,
  `city` varchar(60) NOT NULL,
  `area` varchar(60) NOT NULL,
  `project` varchar(255) NOT NULL COMMENT '训练项目，json数组',
  `remark` varchar(255) DEFAULT NULL COMMENT '注意事项',
  `create_time` int(10) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `team_index` (`team_id`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of train
-- ----------------------------

-- ----------------------------
-- Table structure for `traincourse`
-- ----------------------------
DROP TABLE IF EXISTS `traincourse`;
CREATE TABLE `traincourse` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `bcate` int(11) NOT NULL DEFAULT '0' COMMENT '所属科目分类|0:顶级分类|所属科目分类id',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '科目名',
  `details` varchar(255) NOT NULL DEFAULT '' COMMENT '科目详情',
  `recorder` varchar(45) NOT NULL COMMENT '信息记录员',
  `created_at` int(11) NOT NULL COMMENT '创建时间戳',
  `updated_at` int(11) NOT NULL COMMENT '更新时间戳',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '有效状态|1:有效|0:无效',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='训练科目表';

-- ----------------------------
-- Records of traincourse
-- ----------------------------

-- ----------------------------
-- Table structure for `venue`
-- ----------------------------
DROP TABLE IF EXISTS `venue`;
CREATE TABLE `venue` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `branch` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属机构分部',
  `busi_type` varchar(45) NOT NULL COMMENT '经营模式(合作|加盟|自营)',
  `gri_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '场地类型(1:室内|2:室外)',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态(1:有效|0:无效)',
  `created_at` int(11) NOT NULL,
  `updated_at` int(11) NOT NULL,
  `recorder` varchar(45) NOT NULL COMMENT '信息操作员',
  `remark` varchar(200) NOT NULL DEFAULT '' COMMENT '备注',
  `director` varchar(45) NOT NULL COMMENT '场地主管',
  `income_share` decimal(9,2) NOT NULL DEFAULT '1.00' COMMENT '本部收入占比(%)',
  `dire_percent` decimal(9,2) NOT NULL DEFAULT '0.00' COMMENT '主管提成(%)',
  `price` decimal(9,2) NOT NULL DEFAULT '0.00',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`),
  KEY `fk_ground_organization1_idx` (`branch`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='场地表';

-- ----------------------------
-- Records of venue
-- ----------------------------

-- ----------------------------
-- Table structure for `venue_classteam`
-- ----------------------------
DROP TABLE IF EXISTS `venue_classteam`;
CREATE TABLE `venue_classteam` (
  `ground_id` int(10) unsigned NOT NULL,
  `classteam_id` int(11) NOT NULL,
  PRIMARY KEY (`ground_id`,`classteam_id`),
  KEY `fk_ground_has_classteam_classteam1_idx` (`classteam_id`),
  KEY `fk_ground_has_classteam_ground1_idx` (`ground_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='场地关联班级关系表';

-- ----------------------------
-- Records of venue_classteam
-- ----------------------------

-- ----------------------------
-- Table structure for `_member_coach`
-- ----------------------------
DROP TABLE IF EXISTS `_member_coach`;
CREATE TABLE `_member_coach` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL DEFAULT '0',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  `identity` bigint(18) NOT NULL COMMENT '身份证号',
  `year_exp` tinyint(4) NOT NULL DEFAULT '0' COMMENT '经验年限',
  `profession_levels` tinyint(4) NOT NULL DEFAULT '0',
  `coach_number` tinyint(4) NOT NULL DEFAULT '0' COMMENT '教练身份出场次数',
  `create_time` int(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of _member_coach
-- ----------------------------

-- ----------------------------
-- Table structure for `_member_judge`
-- ----------------------------
DROP TABLE IF EXISTS `_member_judge`;
CREATE TABLE `_member_judge` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `judge_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:未审核，|1：核实，|2：拒绝',
  `coach_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:未审核，|1：核实，|2：拒绝',
  `member_id` int(10) NOT NULL,
  `profession_levels` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0:三级;|1:二级;|2:一级;|3:国家级;|4:国家A级',
  `star` double(3,1) NOT NULL DEFAULT '0.0' COMMENT '评分',
  `total_match` tinyint(4) NOT NULL DEFAULT '0' COMMENT '总场数',
  `year_exp` tinyint(4) NOT NULL DEFAULT '0' COMMENT '工作经验',
  `judge_number` tinyint(4) NOT NULL DEFAULT '0' COMMENT '裁判过的场数',
  `introduction` text NOT NULL COMMENT '个人介绍',
  `tag1` varchar(15) NOT NULL,
  `tag2` varchar(15) NOT NULL,
  `tag3` varchar(15) NOT NULL,
  `tag4` varchar(15) NOT NULL,
  `tag5` varchar(15) NOT NULL,
  `create_time` int(10) NOT NULL,
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of _member_judge
